vs/workbench/contrib/terminal/common/ter.terminal.integrated.commandsToSkipShell:
Conjunto de identificadores de comando cuyos enlaces de teclado no se enviarán al shell, sino que siempre se controlarán con VS Code. Esto permite que los enlaces de teclado que normalmente consumiría el shell actúen igual que cuando el terminal no tiene el foco; por ejemplo, "Ctrl+P" para iniciar Quick Open.

&nbsp;

Muchos comandos se omiten de forma predeterminada. Para reemplazar un valor predeterminado y pasar al shell el enlace de teclado de dicho comando en su lugar, agregue el comando precedido por el carácter "-". Por ejemplo, agregue "-workbench.action.quickOpen" para que "Ctrl+P" llegue al shell.

&nbsp;

La lista de comandos omitidos predeterminados siguiente se trunca cuando se visualiza en el editor de configuraciones. Para ver la lista completa, [abra el archivo JSON de la configuración predeterminada](command:workbench.action.openRawDefaultSettings "Abrir configuración predeterminada (JSON)") y busque el primer comando de la lista siguiente.

